- input: "TEXT\x1CC00474189\x1C.TEXT\x1C\x1CF3A\x1CThis memo is written in response
    to the Commission's preliminary review of the 30 Day Post General Report 2010.
    \ Addressing Item 1 and Item 4:  This was an error in reporting.  The report is
    correct. The William Herbert Hunt contribution and the Kline for Congress contribution
    were inadvertently mixed up on the 48 hour report.  Kline for Congress gave 1000.00
    on 10/21/10 while William Herbert Hunt contributed 500.00 on 10/21/10. Item2:
    \ Mark Snyder contributed 2500.00 on 10/22/10.  The committee proceeded to refund
    100.00 to Mark Snyder which represents the excess funds contributed by Mr. Snyder
    to bring his contribution into compliance.   You will find the refund on line
    20a, dated 10/22/10.  Item 3: The disclosure of a contribution from John Pellegrino
    on 10/20/10 was in-fact a re-attribution from July.  We received consent by Mary
    Pellegrino, contribution date 7/07/10, to re-attribute 1250.00 of excess funds
    from her contribution to her husband on 10/20/10.  We amended the October quarterly
    report to reflect this re-attribution but were unsure as to how to report the
    re-attribution in the 48 hour reporting cycle. Hence, we reported the contribution.
    \ Please review amendment showing this change on 7/07/10.\n"
